import React, { useState } from 'react';
import axiosInstance from './api/axios'; // Assuming you are using axiosInstance for API requests

const AddProperty = () => {
    const [formData, setFormData] = useState({
        address: '',
        deposit: '',
        rent: '',
        waterBill: '',
        lightBill: '',
        paymentDueDate: '',
        tenantEmail: ''
    });
    const [uniqueCode, setUniqueCode] = useState('');
    const [successMessage, setSuccessMessage] = useState('');

    // Handle input change
    const handleInputChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    // Generate a unique 4-digit code
    const generateUniqueCode = () => {
        return Math.floor(1000 + Math.random() * 9000).toString(); // Generate a 4-digit code
    };

    // Handle form submission
    const handleSubmit = async (e) => {
        e.preventDefault();

        // Generate the unique code
        const generatedCode = generateUniqueCode();
        setUniqueCode(generatedCode);

        // Submit property details to backend (Assumed backend API)
        try {
            const response = await axiosInstance.post('/add-property', {
                ...formData,
                uniqueCode: generatedCode, // Add unique code to property data
            });

            if (response.status === 200) {
                setSuccessMessage('Property added successfully! Sending code to tenant...');
                // Send the email to tenant with the unique code
                await axiosInstance.post('/send-code-to-tenant', {
                    email: formData.tenantEmail,
                    uniqueCode: generatedCode,
                    message: `Welcome to DocEase! Please use the unique code ${generatedCode} to access the property information. Click here to sign up: [Sign Up Link]`
                });

                // Clear form
                setFormData({
                    address: '',
                    deposit: '',
                    rent: '',
                    waterBill: '',
                    lightBill: '',
                    paymentDueDate: '',
                    tenantEmail: ''
                });
            }
        } catch (error) {
            console.error('Error adding property:', error);
        }
    };

    return (
        <div className="container mx-auto py-10">
            <h1 className="text-4xl font-bold mb-6">Add a New Property</h1>
            <form onSubmit={handleSubmit} className="bg-white p-8 rounded-lg shadow-md max-w-lg mx-auto">
                <div className="mb-4">
                    <label className="block text-gray-700 text-lg mb-2">Address</label>
                    <input
                        type="text"
                        name="address"
                        value={formData.address}
                        onChange={handleInputChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-lg"
                        required
                    />
                </div>
                <div className="mb-4">
                    <label className="block text-gray-700 text-lg mb-2">Deposit Amount</label>
                    <input
                        type="number"
                        name="deposit"
                        value={formData.deposit}
                        onChange={handleInputChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-lg"
                        required
                    />
                </div>
                <div className="mb-4">
                    <label className="block text-gray-700 text-lg mb-2">Rent Amount</label>
                    <input
                        type="number"
                        name="rent"
                        value={formData.rent}
                        onChange={handleInputChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-lg"
                        required
                    />
                </div>
                <div className="mb-4">
                    <label className="block text-gray-700 text-lg mb-2">Water Bill</label>
                    <input
                        type="number"
                        name="waterBill"
                        value={formData.waterBill}
                        onChange={handleInputChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-lg"
                        required
                    />
                </div>
                <div className="mb-4">
                    <label className="block text-gray-700 text-lg mb-2">Light Bill</label>
                    <input
                        type="number"
                        name="lightBill"
                        value={formData.lightBill}
                        onChange={handleInputChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-lg"
                        required
                    />
                </div>
                <div className="mb-4">
                    <label className="block text-gray-700 text-lg mb-2">Payment Due Date (Monthly)</label>
                    <input
                        type="date"
                        name="paymentDueDate"
                        value={formData.paymentDueDate}
                        onChange={handleInputChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-lg"
                        required
                    />
                </div>
                <div className="mb-4">
                    <label className="block text-gray-700 text-lg mb-2">Tenant's Email</label>
                    <input
                        type="email"
                        name="tenantEmail"
                        value={formData.tenantEmail}
                        onChange={handleInputChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-lg"
                        required
                    />
                </div>
                <button
                    type="submit"
                    className="w-full bg-customGreen text-white py-3 rounded-lg hover:bg-green-600"
                >
                    Add Property
                </button>
            </form>

            {successMessage && (
                <div className="mt-6 text-green-500 text-xl text-center">
                    {successMessage} <br />
                    Unique Code: <strong>{uniqueCode}</strong>
                </div>
            )}
        </div>
    );
};

export default AddProperty;
